            </div>
            <div class="container" id="MealplanContainer">
                <div class="row">
                    <div class="col">
                        Sunday
                    </div>
                    <div class="col">
                        Monday
                    </div>
                    <div class="col">
                        Tuesday
                    </div>
                    <div class="col">
                        Wednesday
                    </div>
                    <div class="col">
                        Thursday
                    </div>
                    <div class="col">
                        Friday
                    </div>
                    <div class="col">
                        Saturday
                    </div>
                </div>
                
            </div>
            </>
            
        )
    }
}

export default MealPlan
